class OptimizedScanner {
	private BufferedReader br;
	private StringTokenizer st;

	public OptimizedScanner() {
		br = new BufferedReader(new InputStreamReader(System.in));
	}

	public OptimizedScanner(File file) throws IOException {
		br = new BufferedReader(new FileReader(file));
	}

	public boolean ready() throws IOException {
		return (br.ready() || st.hasMoreTokens());
	}

	public String next() {
		while (st == null || !st.hasMoreTokens()) {
			try {
				st = new StringTokenizer(br.readLine());
			} catch (IOException e) {
				e.printStackTrace();
			}
		}

		return st.nextToken();
	}

	public int nextInt() {
		return Integer.parseInt(next());
	}

	public long nextLong() {
		return Long.parseLong(next());
	}

	public void close() {
		try {
			br.close();
		} catch (IOException e) {
			e.printStackTrace();
		}
	}
}

class OptimizedWriter {
	private BufferedWriter bw;

	public OptimizedWriter() {
		bw = new BufferedWriter(new OutputStreamWriter(System.out));
	}

	public <T> void write(T value) {
		try {
			bw.write(value.toString());
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	public <T> void writeln(T value) {
		try {
			bw.write(value.toString());
			bw.write('\n');
		} catch (IOException e) {
			e.printStackTrace();
		}
	}

	public <T> void writeNext(T value) {
		write(value);
		write(' ');
	}

	public <T> void writeIterable(Iterable<T> iterable) {
		for (T item : iterable) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(byte[] array) {
		for (byte item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(short[] array) {
		for (short item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(int[] array) {
		for (int item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(long[] array) {
		for (long item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(float[] array) {
		for (float item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(double[] array) {
		for (double item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(char[] array) {
		for (char item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(boolean[] array) {
		for (boolean item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(BigInteger[] array) {
		for (BigInteger item : array) {
			writeNext(item);
		}

		write('\n');
	}

	public void writelnArray(BigDecimal[] array) {
		for (BigDecimal item : array) {
			writeNext(item);
