class Solution:
    def maxFrequency(self, nums, k: int) -> int:
        nums = sorted(nums)
        max_occ = 0
        
        for i, v in enumerate(nums): 
            pnums = nums[:i]
            budget = k
            for j, n in enumerate(pnums[::-1]):
                diff = v-n
                if diff>budget:
                    break
                else:
                    pnums[-(j+1)] += diff
                    budget -= diff

            n_occ = (pnums+nums[i:]).count(v)
            if n_occ > max_occ:
                max_occ = n_occ
                    
        
        return max_occ

