    for (int i = 0; i < n - 1; i++) {
        for (int j = i; j < n - 1; j++) {
            if (i < s - 1 && j < s - 1) {
                newMatrix[i][j] = originalMatrix[i][j];
                newMatrix[j][i] = originalMatrix[j][i];
            }
            else if (i < s - 1 && j >= s - 1) {
                newMatrix[i][j] = originalMatrix[i][j + 1];
                newMatrix[j][i] = originalMatrix[j + 1][i];
            }
            else if (j >= s - 1 && i >= s - 1) {
                newMatrix[i][j] = originalMatrix[i + 1][j + 1];
                newMatrix[j][i] = originalMatrix[j + 1][i + 1];
            }
        }
    }
}

//    
void freeMatrix(int n, int** matrix) {
    for (int i = 0; i < n; i++) {
        free(matrix[i]);
    }
    free(matrix);
}

//       
void inputAdjacencyMatrixFromFile(int n, int** matrix, const char* fileName) {
    FILE* inputFile = fopen(fileName, "r");
    if (inputFile == NULL) {
        printf("   %s.\n", fileName);
        exit(1);
    }

    for (int i = 0; i < n; i++) {
        for (int j = i; j < n; j++) {
            fscanf(inputFile, "%d", &matrix[i][j]);
            matrix[j][i] = matrix[i][j];
        }
    }

    fclose(inputFile);
}

int main() {
    setlocale(LC_ALL, "Russian");
    // 
    printf("\n  :\n");
    printf("1.    :    (input.txt).\n");
    printf("2.    ,           ,\n");
    printf("        input.txt.\n");
    printf("3.    .\n");
    printf("4.      .\n");
    printf("5.         .\n");
    printf("6. ,   , .\n");
    printf("\n:  ,  -13\n");

    //  1:   
    int choice;
    printf("  : 1 - , 2 -  (input.txt)\n");
    scanf("%d", &choice);

    //      
    int n;
    int** m1;
    int** m2;

    //   fileName
    char fileName[30];

    //  2:   
    if (choice == 1) {
        n = inputGraphSize();
    }
    else if (choice == 2) {
        //   
        int fileChoice;
        printf(" : 1 - input1.txt, 2 - input2.txt, 3 - input3.txt\n");
        scanf("%d", &fileChoice);

        //  switch  

        switch (fileChoice) {
        case 1:
            strcpy(fileName, "input1.txt");
            break;
        case 2:
            strcpy(fileName, "input2.txt");
            break;
        case 3:
            strcpy(fileName, "input3.txt");
            break;
        default:
            printf("  . ...\n");
            return 1;
        }

        FILE* inputFile = fopen(fileName, "r");
        if (inputFile == NULL) {
            printf("   %s.\n", fileName);
            return 1;
        }

        fscanf(inputFile, "%d", &n);
        fclose(inputFile);
    }
    else {
        printf(" . ...\n");
        return 1;
    }

    //  3:     
    m1 = allocateAdjacencyMatrix(n);

    //  4:   
    if (choice == 1) {
        //   
        inputAdjacencyMatrix(n, m1);
    }
    else if (choice == 2) {
        //   
        inputAdjacencyMatrixFromFile(n, m1, fileName);
    }

    //  5:   
    printAdjacencyMatrix(n, m1);

    //  6:     
    int s = inputVertexToRemove();

    //  7:      
    m2 = allocateNewMatrix(n);

    //  8:     
    removeVertex(n, m1, m2, s);

    //  9:    
    printAdjacencyMatrix(n - 1, m2);

    //  10:  
    freeMatrix(n, m1);
    freeMatrix(n - 1, m2);

    return 0;
}

