EF2K_pitchbank = compile preprocessFileLineNumbers "\mod\scripts\fsetpitch.sqf";
EF2K_getpb = compile preprocessFileLineNumbers "\mod\scripts\frotate.sqf";

 - Checks for certain jammer pods on plane; if none, checks 
