		};
	// FUTURE: Adjust pitch/bank vector amounts based on _burnThrough
		_msl setvectorup _VXmis;
		_msl setvectordir _VYmis;

		_pbvar = _msl call EF2K_RWR_getpb; // frotate.sqf
		_pitch = _pbvar select 0; // PITCH
