//     
#define MIN_N 2
#define MAX_N 7
#define FILENAME "input.txt"

//       
void inputGraphSize(int* n) {
    printf_s("      [%d; %d]: ", MIN_N, MAX_N);
    scanf_s("%d", n);
}

//      
int checkGraphSize(int n) {
    if (n < MIN_N || n > MAX_N) {
        printf_s(":   n   .\n");
        return 1; //   
    }
    return 0; //   
}

//       
void createAdjacencyMatrix(int n, int(*m1)[MAX_N]) {
    printf_s("  c  %d x %d\n", n, n);
    for (int i = 0; i < n; i++) {
        for (int j = i; j < n; j++) {
            printf_s("m1[%d][%d] = ", i, j);
            scanf_s("%d", &m1[i][j]);
            m1[j][i] = m1[i][j];
        }
    }
}

//       
void readAdjacencyMatrixFromFile(int n, int(*m1)[MAX_N]) {
    FILE* file;
    if (fopen_s(&file, FILENAME, "r") != 0) {
        printf_s("   %s\n", FILENAME);
        exit(1);
    }

    for (int i = 0; i < n; i++) {
        for (int j = i; j < n; j++) {
            fscanf_s(file, "%d", &m1[i][j]);
            m1[j][i] = m1[i][j];
        }
    }

    fclose(file);
}

//       
void printAdjacencyMatrix(int n, int(*m1)[MAX_N]) {
    printf_s("   m1\n");
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            printf_s("%d\t", m1[i][j]);
        }
        printf_s("\n");
    }
}

//       
int countEdges(int n, int(*m1)[MAX_N]) {
    int k0 = 0;
    for (int i = 0; i < n - 1; i++) {
        for (int j = 0; j < n - 1; j++) {
            k0 += m1[i][j];
        }
    }
    return k0 / 2;
}

//      
void countVertexConnections(int n, int(*m1)[MAX_N], int* sum) {
    for (int j = 0; j < n - 1; j++) {
        sum[j] = 0;
        for (int i = 0; i < n - 1; i++) {
            sum[j] += m1[j][i];
        }
    }
}

//     
int checkConnectivity(int n, int* sum) {
    int p = 0;
    for (int i = 0; i < n - 1; i++) {
        if (sum[i] == 0) {
            printf_s(" \n");
            p++;
        }
    }
    return p;
}

//   ,    
int isTree(int k, int n, int p) {
    return (k == n - 2 && p == 0);
}

