    setlocale(LC_ALL, "Russian");

    int n; //     

     // 
    printf_s("\n  :\n");
    printf_s("1.    :    (input.txt).\n");
    printf_s("2.    ,           ,\n");
    printf_s("        input.txt.\n");
    printf_s("3.    .\n");
    printf_s("4.   .\n");
    printf_s("5. ,   , .\n");
    printf_s("\n:  ,  -13\n");

    //    (  )
    printf_s("   (1 - , 2 - ): ");
    int choice;
    scanf_s("%d", &choice);

    //   
    if (choice == 1) {
        //     
        inputGraphSize(&n);

        //     
        if (checkGraphSize(n)) {
            return 1; //   
        }
    }
    else if (choice == 2) {
        //   n    
        printf_s("    %s\n", FILENAME);
        FILE* file;
        if (fopen_s(&file, FILENAME, "r") != 0) {
            printf_s("   %s\n", FILENAME);
            return 1; //   
        }

        //     
        fscanf_s(file, "%d", &n);
        fclose(file);
                //     
        if (checkGraphSize(n)) {
            return 1; //   
        }
    }
    else {
        printf_s(":    .\n");
        return 1; //   
    }

    //     
    int(*m1)[MAX_N] = malloc(MAX_N * sizeof(int[MAX_N]));

    //    
    if (m1 == NULL) {
        printf_s(":       .\n");
        return 1;
    }

    //          
    if (choice == 1) {
        createAdjacencyMatrix(n, m1);
    }
    else if (choice == 2) {
        readAdjacencyMatrixFromFile(n, m1);
    }

    //     
    printAdjacencyMatrix(n, m1);

    //     
    int k = countEdges(n, m1);
    printf_s("  %d \n", k);

    //      
    int sum[MAX_N - 1];

    //    
    countVertexConnections(n, m1, sum);

    //   
    int p = checkConnectivity(n, sum);

    // ,    
    if (isTree(k, n, p)) {
        printf_s("m1  \n\n");
    }
    else {
        printf_s("m1   \n\n");
    }

    //   
    free(m1);

    return 0;
}

